-- ----------------------------
-- Procedure structure for queryFinishedTake
-- ----------------------------
DROP PROCEDURE IF EXISTS `queryFinishedTake`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `queryFinishedTake`(CustomerId int)
begin
	select *
	from boardingpass
	-- if flight.actualArrival == null
	where (boardingpass.CustomerId=CustomerId ) and now()>=(select flight.actualDeparture from flight where flight.flightId=boardingpass.flightId) ;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for queryFlight
-- ----------------------------
DROP PROCEDURE IF EXISTS `queryFlight`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `queryFlight`(date varchar (20),departureAirport varchar(30),arrivalAirprot varchar(30))
begin
	explain select *
	from flight
	where exists(select routeId from route where DATE(route.departureTime)=date and route.departureAirport=departureAirport and route.arrivalAirport=arrivalAirport and route.routeId=flight.routeId);
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for queryOrder
-- ----------------------------
DROP PROCEDURE IF EXISTS `queryOrder`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `queryOrder`(CustomerId int)
(select `order`.orderId,time,boardId,flightId,number,seat,type,price
from `order`  join boardingpass
where `order`.orderId=boardingpass.orderId and `order`.CustomerId=1)
;;
