-- ----------------------------
-- Function structure for boarding
-- ----------------------------
DROP FUNCTION IF EXISTS `boarding`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `boarding`(groundId int,boardId int,isSafe bool,luggageWeight float) RETURNS int(11)
begin
declare flag int;
-- check whether boardId and groundId exists
select count(*) from boardingpass where boardingpass.boardId=boardId into flag;
if(flag=0)then return -1;
end if;
select count(*) from `ground service` where `ground service`.groundId=groundId into flag;
if(flag=0) then return -1;
end if;
-- luggageWeight is not less than 0
if(luggageWeight<0) then return -1;
end if;
-- judge whether the customer can board the flight successfully
set flag=1;
if(isSafe=0) then set flag=0;
end if;
if(luggageWeight>50) then set flag=0;
end if;
return 0;
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for insertBoardingPass
-- ----------------------------
DROP FUNCTION IF EXISTS `insertBoardingPass`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `insertBoardingPass`(orderId int, takerId int,flightId int,number int,seat int,type int) RETURNS varchar(50) CHARSET utf8
begin
	declare price float;
	declare buyerId int;
	declare flag bool;
	declare customerCount int;
	declare seatCount int;
  select CustomerId into buyerId from `order` where `order`.orderId=orderId;
	select count(*) from customer where customer.CustomerId=takerId into flag;
	if(flag=0) then return "No takerId.";
	end if;
	select count(*) from flight where flight.flightId=flightId into flag;
	if(flag=0) then return "No flightId.";
	end if;
	select count(*) from boardingpass where boardingpass.seat=seat into flag;
	if(flag=0) then return "Busy seat.";
	end if;
	if type<1 or type>3 then return "Wrong type.";
	end if;
	select flight.customerCount,flight.seatCount from flight where flight.flightId=flightId into customerCount,seatCount;
	if(customerCount=seatCount) then return "No enough seats.";
	end if;
	if type=1 then
		select firstClassPrice into price
		from flight
		where flight.flightId=flightId;
	end if;
	if type=2 then
		select businessClassPrice into price
		from flight
		where flight.flightId=flightId;
	end if;
	if type=3 then
		select economyClassPrice into price
		from flight
		where flight.flightId=flightId;
	end if;
	update customer
	set customer.money=customer.money-price
	where customer.CustomerId=buyerId;
	update flight
	set flight.customerCount=flight.customerCount+1
	where flight.flightId=flightId;
	return "Success.";
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for insertFlight
-- ----------------------------
DROP FUNCTION IF EXISTS `insertFlight`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `insertFlight`(routeId int,flightNumber varchar(8),date date,actualDeparture datetime,actualArrival datetime,customerCount int,seatCount int,isDelayed bool,isCancelled bool,firstClassPrice float,businessClassPrice float,economyClassPrice float,status varchar(20)) RETURNS varchar(50) CHARSET utf8
begin
	declare flag int;
	declare scheduledDeparture datetime;
	declare scheduledArrival datetime;
  select departureTime from route where route.routeId=routeId into scheduledDeparture;
	select arrivalTime from route where route.routeId =routeId into scheduledArrival;
  select count(*) from route where route.routeId=routeId into flag;
	if(flag=0) then return "Wrong routeId.";
	end if;
	if customerCount>seatCount then return "Wrong count.";
	end if;
	if not isDelayed and scheduledDeparture<actualDeparture then return "Delay.";
	end if;
	if isDelayed and scheduledDeparture>=actualDeparture then return "No delay.";
	end if;
	if not isCancelled and actualDeparture is null then return "Cancel.";
	end if;
	if isCancelled and not actualDeparture is null then return "No cancel.";
	end if;
	if isDelayed and isCancelled then return "No both delay and cancel.";
	end if;
	if (isDelayed and status<>"delayed") or (isCancelled and status<>"cancelled") then return "Wrong status.";
	end if;
	if status<>"normal" and status<>"delayed" and status<>"cancelled" then return "Wrong status.";
	end if;
	return "Success.";
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for insertNotification
-- ----------------------------
DROP FUNCTION IF EXISTS `insertNotification`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `insertNotification`(flightId int,adminId int) RETURNS int(11)
begin
declare ifCancel int;
declare done int default 0;
declare o_id int;
declare id int;
declare buyer_id int;
declare type int;
declare money float;
declare flag bool;
declare takeItem cursor for select  CustomerId,orderId,price from boardingpass where boardingpass.flightId=flightId;
declare continue HANDLER for not found set done = 1; 
-- check whether flightId and adminId exists
select count(*) from flight where flight.flightId=flightId into flag;
if(flag=0) then return -1;
end if;
select count(*) from administrator where administrator.adminId=adminId into flag;
if (flag=0)then return -1;
end if;
-- ifCancel :    1:the flight is cancelled 0:the flight is delayed
select isCancelled
from flight
where flight.flightId=flightId
into ifCancel;
-- insert into notification table,update money attribute of customer table
open takeItem;
take_loop:loop
fetch takeItem into id,o_id,money;
select CustomerId from `order` where `order`.orderId=orderid into buyer_id;
if done=1 then  
leave take_loop;  
end if;   
-- give money back
update customer set customer.money=customer.money+money*(ifCancel+1)/2 where customer.CustomerId=buyer_id;
end loop take_loop;
close takeItem;
return 0;
end
;;
DELIMITER ;

