-- ----------------------------
-- Function structure for updateStatus
-- ----------------------------
DROP FUNCTION IF EXISTS `updateStatus`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `updateStatus`(adminId int,flightId int, actualDeparture datetime, actualArrival datetime) RETURNS varchar(50) CHARSET utf8
begin
	declare scheduledDeparture datetime;
	declare routeId int;
	declare flag bool;
	declare prevDepartureTime datetime;
	declare prevArrivalTime datetime;
	declare prevStatus varchar(10);
	select routeId from flight where flight.flightId=flightId into routeId;
	select count(*)from flight where flight.flightId=flightId into flag;
	if(flag=0) then return "No flightId.";
	end if;
	if actualDeparture>=actualArrival then return "Wrong time.";
	end if;
	select actualDeparture,actualArrival
	from flight
	where flight.flightId=flightId
	into prevDepartureTime,prevArrivalTime;
	update flight
	set flight.actualDeparture=actualDeparture,flight.actualArrival=actualArrival
	where flight.flightId=flightId;
	select route.departureTime into scheduledDeparture
	from route
	where route.routeId=routeId;
	if scheduledDeparture>=actualDeparture then
		select status
    from flight
		where flight.flightId=flightId
		into prevStatus;
		update flight
		set isDelayed=false,isCancelled=false,status="normal"
		where flight.flightId=flightId;
	end if;
	if scheduledDeparture<actualDeparture then
		select status
    from flight
		where flight.flightId=flightId
		into prevStatus;
		update flight
		set isDelayed=true,isCancelled=false,status="delayed"
		where flight.flightId=flightId;
	end if;
	if actualDeparture is null then
		select status
    from flight
		where flight.flightId=flightId
		into prevStatus;
		update flight
		set isDelayed=false,isCancelled=true,status="cancelled"
		where flight.flightId=flightId;
	end if;

	return "Success.";
end
;;
DELIMITER ;
